The entry renovation! ✨ I can’t believe how much this has changed. The old musty smell left with the old carpet, and bringing out that white oak and new paint really brightened it up! 
@professional_hardwood_flooring did an incredible job with the stairs and balusters, and Gabe took on the railings himself. (We are still debating whether that was worth the saved funds😂). You can catch this chandelier install on stories right now, and we will have the blog post up this week with total costs and supplies used. 

We love this home, and are so grateful for the chance to make it our own! #hometakestime

Today we launch a project near and dear to us! Our custom designed and locally crafted kitchen board collection. 

These started with a sketch, and were brought to life by a team of talented craftsmen. We envisioned these boards for multiple uses, and we hope they can bring value to your home and gatherings.

All boards are made of locally sourced and milled walnut or maple wood, and are heirloom quality and made to last for years to come!

We appreciate this community! Thank you for the support every step of the way. 🤍

